                        <Route exact path="/">
                              <Redirect to="/Home"/>
                        </Route>
                        <Route exact path="/WeatherApp" component={WeatherApp}/>
                        <Route exact path="/RecipeApp" component={RecipeApp}/>

                        <Route exact path="/ForecastHourly/:id" component={ForecastHourly}/>
